import React, { useEffect, useState } from 'react'


function HouseItems() {
    const [houseItems, setHouseItems] = useState([]);
    useEffect(()=>{
        fetch('https://hms-server1235.herokuapp.com/houses')
        .then((res)=>res.json())
        .then((data)=>setHouseItems(data))

    })
  return (
    <div>HouseItems</div>
  )
}

export default HouseItems
